package io.github.qianlixy.cache.exception;

public class ExecuteSourceMethodException extends Exception {

	private static final long serialVersionUID = 7774755801042951417L;

	public ExecuteSourceMethodException() {
		super();
	}

	public ExecuteSourceMethodException(String message, Throwable cause) {
		super(message, cause);
	}

	public ExecuteSourceMethodException(String message) {
		super(message);
	}

	public ExecuteSourceMethodException(Throwable cause) {
		super(cause);
	}

}
